import React from 'react'
import Chart from "react-apexcharts";

const Results = (props) => {

    

  return (
    <div id='poll-results'>
        <Chart
              options={pollSelected.options}
              series={pollSelected.Results}
              type="bar"
              width="500"
            />
    </div>
  )
}

export default Results
